//});
export const Display = () => {
	const [data, setData] = useState('')
	async function recentWord(){
		return axios({
			method:'POST',
			url:'/recentword',
			data: {test:'data'},
			headers: {
				'Content-Type':'application/json',
			}
		})
			.then(function(res){
				setData(res.data)})
			.catch(function(err){
				console.log(err)
			});
	}
	useEffect(()=>{
		recentWord();
	},[]);
        return (
		<div>
			<p>data: {data}</p>
		</div>
        );
}
